import React from 'react'
import ArtItems from '../components/ArtItems.js'
import { v4 as uuidv4 } from 'uuid';

const Art = () => {
  return (
    <div>
      <img src={require('./../img/art/building.jpg')} alt="nope"/>
      {ArtItems.map((artItem, i) => {
        return <img 
          key={uuidv4()}
          // src={require('./../img/art/' + artItem.image)}
          alt={artItem.title}
          />
      })}
    </div>
  )
}

export default Art
